import React from 'react';
// import { useNavigate } from 'react-router-dom';
// import { Link } from 'react-router-dom';
import './Login.css'
import loginVisual from './Resume/pigImage1.png';
import veiybLogo from './Resume/pigImage1.png';
import { useForm } from "react-hook-form";
import UpdatePage from "../hooks/updatePage"

const AdminProfile = () => {
    const { register, handleSubmit } = useForm();
    const navigateToLogin = () =>{
        window.location.href = "/login";
    }
    const onSubmit = async (data) => {
        var response = await UpdatePage(data, navigateToLogin);
        if(response != undefined)
        {
        // && response.data.includes("success")){
         //navigate('/projects')
        };
    }

    return (
        <div className="container" id="ProfileContainer">
            <form onSubmit={handleSubmit(onSubmit)}>
         <div className='form-group'>
           <h1>Admin Profile</h1>
           <div>Website Landing Image</div>
           <input className="form-control" name="LandingFile"{...register('LandingFile')} type="file"></input>        
           <div>Pig Law content</div>
           <textarea className="form-control" name="ContentOne"{...register('ContentOne')} type="textarea"></textarea>
           <div>Pig History Content</div>
           <textarea className="form-control" name="ContentTwo"{...register('ContentTwo')} type="textarea"></textarea>
           <div>Gallery images</div>
           <input className="form-control"  name="GalleryFiles"{...register('GalleryFiles')} type="file" multiple></input> 
           <button className="submit btn btn default" type="submit">Submit</button>
           </div>
           </form>             
        </div>
    )
}

export default AdminProfile;
